<script>
    function node(value){
        this.value = value
        this.next = null
    }

    const element = new node(9)
    const element2 = new node(10)

    const element3 = new node(15)
    const element5 = new node(80)
    const element6 = new node(50)

    const element4 = new node(45)

    element.next = element2
    element2.next = element3
    element3.next = element5
    element5.next = element6
    element6.next = element4

    let curr = element

    while(curr!=null){
    console.log(curr.value)
    curr = curr.next
}
</script>
